<!DOCTYPE html>
<html>
<head>
    <title>Example page for warren graph</title>
    <script data-main="main.js" type="text/javascript" src="bower_components/requirejs/require.js"></script>
    <link rel="stylesheet" type="text/css" href="style.css">
</head>
<body>
    <svg width="0" height="0">
    	<defs>
	    <linearGradient id="exampleGradient" x1="0%" y1="0%" x2="50%" y2="50%">
	      <stop offset="0%" style="stop-color:#8e9eab;stop-opacity:1" />
	      <stop offset="100%" style="stop-color:#eef2f3;stop-opacity:1" />
	    </linearGradient>
	  </defs>
    </svg>
    <div>
        <strong>Warren</strong>
        a series of underground tunnels where rabbits live
    </div>
    <div id="graph" class="graphParent"></div>
    <pre id="data"></pre>
</body>
</html>
